its.BaseApp = {
    CONSECUTIVE_TAB_SELECTS: {
      tab: null,
      count: 0
    },

    initialTab: function(launchData) {
        var initialTab;
        var isAnyIPhoneOrIPad = its.serverData && its.serverData.constants
                && (its.serverData.constants.isAnyIPhone || its.serverData.constants.isAnyIPad);
        if (isAnyIPhoneOrIPad) {
            if ((!launchData || (!launchData.url && !launchData.storeSheet)) && (typeof(TabBar) != "undefined")) {
                initialTab = TabBar.selectedTab;
            }
        }
        return initialTab;
    },

    currentPage: function() {
        return this.currentDocument() ? this.currentDocument().documentElement : null;
    },

    currentDocument: function() {
        if (modal.documents.length > 0) {
            return modal.documents[modal.documents.length-1];
        } else if (TabBar) {
            return TabBar.selectedTab.navigationDocument.documents[TabBar.selectedTab.navigationDocument.documents.length-1];
        } else if (navigationDocument) {
            return navigationDocument.documents[navigationDocument.documents.length-1];
        }
    },

    launchFunction: function(launchData, launchSource) {
        var debugLaunchDelay = App.debugLaunchDelay();

        console.log("----------------- Launching via:" + launchSource + " with " + debugLaunchDelay + "ms delay -----------------");
        if (debugLaunchDelay) {
            setTimeout(function () {
                App._onLaunch(launchData);
            }, debugLaunchDelay)
        } else {
            App._onLaunch(launchData);
        }
    },

    logStartupError: function(message) {
        if (its.sf.DelayedCallQueue) {
            its.sf.DelayedCallQueue.call('its.Logger', function () {its.Logger.named('appBootstrap').error(message);});
        } else {
            console.log(message);
        }
    },

    /**
     * Callback to tell the app that the revNum has changed, and it needs to reload itself.
     */
    onRevNumChanged: function(revNum) {
        console.log('onRevNumChanged() should be implemented by the app.');
    },

    getSavedRestoreData: function() {
        var restoreThreshold = its.serverData.properties["its.sf14.History.savedRestoreDataThreshold"]
                ? (its.serverData.properties["its.sf14.History.savedRestoreDataThreshold"] * 60000)
                : 600000; // Default to 10 minutes

        var historyFromStorage = localStorage.getItem('RESTORE_DATA_KEY');
        var savedRestoreData = historyFromStorage ? JSON.parse(historyFromStorage) : {};

        var haveValidRestoreData = false;
        if (savedRestoreData.timeStamp) {
            var timeSaved = new Date(savedRestoreData.timeStamp);
            var threshold = new Date(new Date().getTime() - restoreThreshold);

            // <rdar://problem/18308122> ITML: itms.storefront is undefined when user is not logged in
            var currentStorefront = this.baseStorefront();
            var didStorefrontChange = true;
            if (currentStorefront) {
                didStorefrontChange = savedRestoreData.storefront != currentStorefront;
            }
            haveValidRestoreData = ((timeSaved - threshold) > 0) && (Object.keys(savedRestoreData).length > 1) && !didStorefrontChange;
        }

        if (!haveValidRestoreData) {
            savedRestoreData = {
                timeStamp: new Date().toISOString()
            };
            localStorage.setItem('RESTORE_DATA_KEY', JSON.stringify(savedRestoreData));
        }

        return haveValidRestoreData ? savedRestoreData : null;
    },

    /**
     * Sets the current revNum.
     * If the revNum changes, then it invalidates the app -- the app eventually reloads the code on
     * the next available opportunity (onResume)
     * @param revNum the new revNum to be set.
     * @param timestamp the date-time when the properties were last changed in the server (in ISO 8601 format)
     */
    setRevNum: function(revNum, timestamp) {
        // Make sure there's revNum set.
        if (revNum) {
            // First Time
            if (!this._revNum) {
                this._revNum = revNum;
                this._propertiesTimestamp = timestamp;
                // Typically (when revnum has changed and is due to a more recent property changes)
                // NOTE: string comparison of timestamp here works as ISO 8601 is lexicographically ordered
            } else if ((this._revNum != revNum) && (this._propertiesTimestamp < timestamp)){
                this._revNum = revNum;
                this._propertiesTimestamp = timestamp;
                this.onRevNumChanged(revNum);
            }
        }
    },

    // Get the storefront string before the first space in itms.storefront. Meaning no ab test string etc...
    baseStorefront: function() {
        var storefrontString = itms.storefront;
        var baseStorefrontString = null;
        // <rdar://problem/18308122> ITML: itms.storefront is undefined when user is not logged in
        if (storefrontString) {
            var firstSpaceIndex = storefrontString.indexOf(' ');
            baseStorefrontString = (firstSpaceIndex != -1) ? storefrontString.substr(0, firstSpaceIndex) : storefrontString;
        }
        return baseStorefrontString;
    },

    isLaunchFailedAvailable: function() {
        var appIdentifier = Device.appIdentifier;
        return (!!App.launchFailed /*NS_AVAILABLE_IOS(10_0)*/ &&
                appIdentifier != "com.apple.iBooks" &&
                appIdentifier != "com.apple.podcasts");
    },

    shouldReloadTabOnSelect: function() {
        // This logic lives elsewhere, but may not be loaded yet in a failure case
        var isVoyager = (Device.appIdentifier == "com.apple.MobileSMS");
        if (!isVoyager) {
            return false;
        }
        var isManageTab = (TabBar.selectedTab.identifier == "managed");
        return !isManageTab
    },

    launchFailed: function() {
        if (this.isLaunchFailedAvailable()) {
            App.launchFailed();

            // <rdar://problem/27706317> If we get into a state where the bootstrap launch has
            // failed, there isn't much we can do to recover from it. We'll just hijack the tab-
            // bar so that tapping a tab does roughly the same thing as tapping the "Retry" button
            // on the error presented by the App.launchFailed() function.
            var reload = function () {
                if (itms.networkConnectionType == "") {
                    App.launchFailed();
                } else {
                    App.reload();
                }
            };
            TabBar.onSelect = function () {
                if(its.BaseApp.shouldReloadTabOnSelect()){
                    reload();
                }
            };
            TabBar.onNeedsContent = function () {
                // Needed for the onSelect event listener to work.
            };
            Device.onNetworkChange = reload;
        }
    }
};

/**
 * Add the current app identifier to the resource urls provided as a query param
 *
 * @param urls list of resource urls
 * @return List of urls with the attached identifier
 */
its.BaseApp.addAppIdentifierToResourceUrls = function(urls) {
    var appIdentifier = Device.appIdentifier;

    var modifiedUrls = [];

    urls.forEach(function(baseUrl) {
        var sep = (baseUrl.indexOf('?') === -1) ? "?" : "&";
        var url = baseUrl + sep + "app="+ appIdentifier ;
        modifiedUrls.push(url);
    });

    return modifiedUrls;
};

App.appOnLaunchStartTime = null;
App.onBagChangeCallbackCalled = false;

App.setDebugLaunchDelay = function(delayInMilliseconds) {
    if (typeof(delayInMilliseconds) === 'undefined') delayInMilliseconds = 0;
    localStorage.setItem("debugLaunchDelay", delayInMilliseconds);

    return delayInMilliseconds;
}

App.debugLaunchDelay = function() {
    var debugLaunchDelay = localStorage.getItem("debugLaunchDelay");

    if (!debugLaunchDelay || (debugLaunchDelay == "")) debugLaunchDelay = "0";
    debugLaunchDelay = parseInt(debugLaunchDelay);

    return debugLaunchDelay;
}

App.clearDebugLaunchDelay = function() {
    localStorage.removeItem("debugLaunchDelay");
}

App.onLaunch = function(launchData) {
    App.appOnLaunchStartTime = new Date().getTime();

    if (itms.getBag && !itms.getBag()) {
        var timeout = 5; // todo: Could set this via serverData props and default to 5 if not found

        its.BaseApp.logStartupError("Bag: Error: launchOrWaitForBag found no bag, waiting for bag change...");

        setTimeout(function () {
            if (!App.onBagChangeCallbackCalled) {
                its.BaseApp.logStartupError("Bag: Error: itms.onBagChange not called within:" + timeout + " seconds");

                if (its.BaseApp.isLaunchFailedAvailable()) {
                    itms.onBagChange = function () { /* Do nothing. */ };
                    its.BaseApp.launchFailed();
                }
            }
        }, timeout * 1000);

        itms.onBagChange = function () {
            // Once the app has launched we dont need to try and relaunch when the bag changes.
            // We only care about this if we didnt have a bag at time of initial launch.
            if (!App.hasLaunched) {
                App.onBagChangeCallbackCalled = true;

                var callbackTime = new Date().getTime();

                its.BaseApp.logStartupError("Bag: Error: itms.onBagChange bag load wait time:" + (callbackTime - App.appOnLaunchStartTime) + "ms");
                its.BaseApp.launchFunction(launchData, "itms.onBagChange");
            }
        }
    } else {
        its.BaseApp.launchFunction(launchData, "App.onLaunch");
    }
};

App._onLaunch = function(launchData) {
    App.hasLaunched = true;
    App.resourcesLoaded = false;

    console.log('----------------- App._onLaunch -----------------');
    var launchStepsRemaining = 2;

    launchData.jsResourcesStartTime = new Date().getTime();
    var onJsLoaded = function(jsLoaded) {
        if (!jsLoaded && its.BaseApp.isLaunchFailedAvailable()) {
            its.BaseApp.launchFailed();
            return;
        }
        launchData.jsResourcesEndTime = new Date().getTime();
        its.Templates.fetchTemplates(its.BaseApp.addAppIdentifierToResourceUrls(its.templateResources), function(templatesLoaded) {
            if (!templatesLoaded && its.BaseApp.isLaunchFailedAvailable()) {
                its.BaseApp.launchFailed();
                return;
            }

            launchStepsRemaining--;
            if (launchStepsRemaining == 0) {
                App.resourcesLoaded = true;
                its.App.onLaunch(launchData);
                App._executeResumeQueue();
            }
        })
    };

    var fetchInitialPageData = function() {
        var initialTab = its.BaseApp.initialTab(launchData);

        if (initialTab && initialTab.rootURL) {
            var launchUrl = initialTab.rootURL;
            var req = itms.makeStoreXMLHttpRequest();
            // Sochi still needs this due to <rdar://problem/16160457> Store XHR loses reference to the onreadystatechange callback
            its.sf14.reqs[launchUrl] = req;
            req.onreadystatechange = function () {
                if (req.readyState == 4) {
                    if (req.status == 200) {
                        try {
                            launchData.initialPageData = JSON.parse(req.responseText);
                            launchData.initialPageData.url = initialTab.rootURL;
                            launchData.initialPageData.pageTarget = initialTab.identifier;
                            //setting xhr metrics timings for the initial grouping page
                            launchData.metrics = req.metrics;
                        } catch (errorr) {
                            console.log('---------- Error fetched initial page data: ');
                        }
                    }
                    delete its.sf14.reqs[launchUrl];
                    launchStepsRemaining--;
                    if (launchStepsRemaining == 0) {
                        App.resourcesLoaded = true;
                        its.App.onLaunch(launchData);
                        App._executeResumeQueue();
                    }
                }
            };

            req.open('GET', launchUrl, true);
            req.send(null);
        } else {
            launchStepsRemaining--;
        }
    };

    var savedRestoreData = its.BaseApp.getSavedRestoreData();
    if (savedRestoreData) {
        launchData.restoreData = savedRestoreData;
        launchStepsRemaining--;
    } else {
        // Fetch the initial page data if we don't have some external url coming in. This allows us to fetch the page data
        // and JS resources in parallel.
        fetchInitialPageData();
    }

    // Fetch all JS resources.
    itms.evaluateScripts(its.BaseApp.addAppIdentifierToResourceUrls(its.javascriptResources), onJsLoaded);
};

App.onExit = function() {
    console.log('----------------- App.onExit -----------------');
    if (typeof(its) != "undefined" && typeof(its.App) != "undefined" && typeof(its.App.onExit) != "undefined") {
        its.App.onExit();
    }
};

App.onResume = function(resumeData) {
    console.log('----------------- App.onResume -----------------');

    if (!App._resumeQueue) {
        App._resumeQueue = [];
    }

    if (!App.resourcesLoaded) {
        console.warn('----------------- App.onSuspend, called before App.resourcesLoaded has been set, queuing up an onResume event with event data:', resumeData);
        App._resumeQueue.push(resumeData)
    } else if (typeof(its) != "undefined" && typeof(its.App) != "undefined" && typeof(its.App.onResume) != "undefined") {
        its.App.onResume(resumeData);
    }
};

/**
 * There are cases in where onResume gets called before all of the resources have been loaded to start the app
 * In these cases the resumeData for each even is added to the App._resumeQueue. Once all of the app resources, i.e.
 * templates and js have been loaded we will execute onResume with each of the queued up resumeData objects in the queue.
 *
 * @private
 */
App._executeResumeQueue = function() {
    if (App._resumeQueue) {
        for (var ii = 0; ii < App._resumeQueue.length; ii++) {
            its.App.onResume(App._resumeQueue[ii]);
        }
        App._resumeQueue = [];
    }
};

App.onSuspend = function(obj) {
    console.log('----------------- App.onSuspend -----------------');
    if (typeof(its) != "undefined" && typeof(its.App) != "undefined" && typeof(its.App.onSuspend) != "undefined") {
        its.App.onSuspend(obj);
    }
};

